      list: [
        {cid: 123, title: 'Maxb Learn React Lession1'},
        {cid: 456, title: 'Maxb Learn React Lession2'},
        {cid: 789, title: 'Maxb Learn React Lession3'}
      ]
    }
  }
  componentDidMount() {
    console.log(this.props.match.params.id)
  }
  render() {
    return (
      <h2>PPP</h2>
    )
  }
}

export default List
